function tabsub(e,t){var n=document.getElementById(e).getElementsByTagName("li"),l=document.getElementById(t).getElementsByTagName("div");if(n.length==l.length)for(var o=0;o<n.length;o++)n[o].id=o,n[o].onmouseover=function(){for(var e=0;e<n.length;e++)n[e].className="",l[e].style.display="none";this.className="action",l[this.id].style.display="block"}}window.onload=function(){tabsub("list_ul","content")},console.log("gulp dewn ............");